  const store = useSelector((store: any) => store)
  const { showModal } = store;
  const { modalStatus } = showModal;
  console.log("\n\t modalStatus: ", showModal)
  return (
    <div className="home-screen d-flex">
      {
        modalStatus
      }
        <div className="d-flex row justify-content-center">
            <button 
                data-target="#modal"
                data-toggle="modal"
                style={{width: "10vw"}} 
                className="animate__animated animate__bounce animate__infinite btn btn-info self-center text-dark btn-box-shadow">
                Explore!
            </button>
        </div>
    </div>
  )
}

export default HomeScreen
